// ==UserScript==
// @name         Roblox 2011-2015 Favicon
// @namespace    http://krisbies.neocities.org/
// @version      1.2
// @description  Replaces the current Roblox Favicon the one from 2011
// @author       Kristi W.
// @match        http*://www.roblox.com/*
// @icon         data:image/png;base64,
// @grant        none
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/544046/Roblox%202011-2015%20Favicon.user.js
// @updateURL https://update.greasyfork.org/scripts/544046/Roblox%202011-2015%20Favicon.meta.js
// ==/UserScript==

var head = document.getElementsByTagName('head')[0];
var icon = document.createElement('link');

icon.setAttribute('type', 'image/x-icon');
icon.setAttribute('rel', 'icon');

icon.setAttribute('href', 'data:image/x-icon;base64,');

head.appendChild(icon);